<?php
namespace ITM\OutstandingPayments\Setup;

use Magento\Eav\Setup\EavSetupFactory;
use Magento\Framework\Setup\InstallDataInterface;
use Magento\Framework\Setup\ModuleContextInterface;
use Magento\Framework\Setup\ModuleDataSetupInterface;

class InstallData implements InstallDataInterface
{


    /**
     *
     * @var  \Magento\Framework\ObjectManagerInterface
     */
    protected $_objectManager;


    /**
     * @var \Magento\Store\Model\StoreManagerInterface
     */
    protected $_storeManager;


    /**
     * @var \Magento\Catalog\Model\ProductFactory
     */
    protected $_productFactory;


    /**
     * @var \Magento\Catalog\Api\ProductRepositoryInterface
     */
    protected $_productRepository;


    private $_customerSetupFactory;

    protected $state;
    

     /**
     * Init
     *
     * @param EavSetupFactory $eavSetupFactory
     */
    public function __construct(
        \Magento\Framework\ObjectManagerInterface $objectManager,
        \Magento\Framework\App\State $state,
        \Magento\Store\Model\StoreManagerInterface $storeManager,
        \Magento\Catalog\Model\ProductFactory $productFactory,
        \Magento\Catalog\Api\ProductRepositoryInterface $productRepository,
        \Magento\Customer\Setup\CustomerSetupFactory $customerSetupFactory
    ) {
        $this->_objectManager = $objectManager;
        $this->_storeManager = $storeManager;
        $this->_productFactory = $productFactory;
        $this->_productRepository = $productRepository;
        $this->_customerSetupFactory = $customerSetupFactory;

        $this->state = $state;
        
        
     
    }

    public function installCustomerAttribute($setup){

        $customerSetup = $this->_customerSetupFactory->create(['setup' => $setup]);
        $customerSetup->addAttribute(\Magento\Customer\Model\Customer::ENTITY, 'itm_sap_company', [
            'type' => 'varchar',
            'label' => 'SAP Company',
            'input' => 'select',
            'source' => 'ITM\OutstandingPayments\Model\Customer\Attribute\Source\Company',
            'required' => false,
            'visible' => true,
            'position' => 360,
            'system' => false,
            'backend' => ''
        ]);


        $attribute = $customerSetup->getEavConfig()->getAttribute('customer', 'itm_sap_company')
        ->addData(['used_in_forms' => [
            'adminhtml_customer'
        ]]);
        $attribute->save();

    }
    /**
     * {@inheritdoc}
     */
    public function install(ModuleDataSetupInterface $setup, ModuleContextInterface $context)
    {
        

        $this->installCustomerAttribute($setup);
        try{
             $this->state->getAreaCode();
        }
        catch (\Magento\Framework\Exception\LocalizedException $ex) {
            $this->state->setAreaCode('adminhtml');
        }
        
        /** @var \Magento\Eav\Setup\EavSetup $eavSetup */

        $sku = "sap_invoice";

        $product = $this->_objectManager->create('\Magento\Catalog\Api\Data\ProductInterface');
        $media_1 = $this->_objectManager->create('Magento\Catalog\Api\Data\ProductAttributeMediaGalleryEntryInterface');
        $content = $this->_objectManager->create('\Magento\Framework\Api\Data\ImageContentInterface');


        //$productRepository = $this->_objectManager->create('Magento\Catalog\Api\ProductRepositoryInterface');


        $_product =  $this->_productFactory->create()->loadByAttribute('sku', $sku);
        if(!$_product) {
            $product->setName("Payment");
            $product->setTypeId('payment');
            $product->setStatus(\Magento\Catalog\Model\Product\Attribute\Source\Status::STATUS_ENABLED);
            $product->setAttributeSetId(4);
            $product->setSku($sku);
            $product->setTaxClassId(0);  //tax_class_id
            $product->setWebsiteIds([$this->_storeManager->getDefaultStoreView()->getWebsiteId()]);
            $product->setVisibility(\Magento\Catalog\Model\Product\Visibility::VISIBILITY_NOT_VISIBLE);
            $product->setPrice(0);
            $product->setStoreId(\Magento\Store\Model\Store::DEFAULT_STORE_ID);
            $product->setStockData(array(
                'use_config_manage_stock' => false, //'Use config settings' checkbox
                'manage_stock' => false, //manage stock
                'min_sale_qty' => 1, //Minimum Qty Allowed in Shopping Cart
                //'max_sale_qty' => 1 //Maximum Qty Allowed in Shopping Cart
            )
                );
            $product->setHasOptions(1);


            $media_1->setLabel("Pay Invoice");
            $media_1->setPosition(0);
            $media_1->setDisabled(false);
            $media_1->setTypes(["image","small_image","thumbnail"]);

            $content->setType("image/jpeg");
            $content->setName("pay_invoice.jpg");
            $content->setBase64EncodedData("");

            $media_1->setContent($content);
            $media_1->setMediaType("image");

            $mediaGalleryEntries [] = $media_1;
            $product->setMediaGalleryEntries($mediaGalleryEntries);

            $customOption_doc_entry = $this->_objectManager->create('Magento\Catalog\Api\Data\ProductCustomOptionInterface');
            $customOption_doc_entry->setTitle('DocEntry')
            ->setType('field')
            ->setIsRequire(true)
            ->setSortOrder(1)
            ->setPrice(0)
            ->setPriceType('fixed')
            ->setMaxCharacters(10)
            ->setProductSku($sku);


            $customOption_amount = $this->_objectManager->create('Magento\Catalog\Api\Data\ProductCustomOptionInterface');
            $customOption_amount->setTitle('Amount')
            ->setType('field')
            ->setIsRequire(false)
            ->setSortOrder(2)
            ->setPrice(0)
            ->setPriceType('fixed')
            //->setMaxCharacters()
            ->setProductSku($sku);

            $customOptions[] = $customOption_doc_entry;
            $customOptions[] = $customOption_amount;

            $product->setCanSaveCustomOptions(true);
            $product->setOptions($customOptions);

            $this->_productRepository->save($product);
       }

    }
}